  <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.5.2/css/all.min.css">
  <style>
    /* Define CSS for adjusting image width and height */
    .contact-image {
      width: 200px;
      /* Set the desired width */
      height: auto;
      /* Maintain aspect ratio */
    }
  </style>
</head>

<body id="top">
  <!-- intro section
   ================================================== -->
  <section id="intro">
    <!-- <div class="intro-overlay"></div> -->

    <div class="intro-content">
      <div class="row">
        <div class="col-twelve">
          <h5 style="color: #182b72;">Hello, World.</h5>
          <h1 style="color: #182b72;">IT's TRAVERSA COMPANY.</h1>

          <p class="intro-position">
            <span style="color: #182b72;">THE ACCESS OF THE WORLD</span>
          </p>

          <button id="save-btn" class="button stroke smoothscroll" href="#" title="">
            Save Contact
          </button>
          <ul class="intro-social">
            <li>
              <a href="https://www.instagram.com/traversa_company/"><i class="fa-brands fa-instagram" style="color: #182b72;"></i></a>
            </li>
            <li>
              <a href="https://twitter.com/traversacompany"><i class="fa-brands fa-twitter" style="color: #182b72;"></i></a>
            </li>
            <li>
              <a href="https://www.tiktok.com/@traversa_company"><i class="fa-brands fa-tiktok" style="color: #182b72;"></i></a>
            </li>
            <li>
              <a href="https://maps.app.goo.gl/NB2h6fQpaA1xWmLW6"><i class="fa-regular fa-map" style="color: #182b72;"></i></a>
            <li>
              <a href="tel:+96176427659"><i class="fa-solid fa-phone" style="color: #182b72;"></i></a>
            </li>

          </ul>
        </div>
      </div>
    </div>
    <!-- /intro-content -->


    <!-- /intro-social -->
  </section>
  <script>
    var saveBtn = document.getElementById("save-btn");
    saveBtn.addEventListener("click", function() {

      // Get the contact information from the website
      var contact = {
        name: "Mahmoud Merhi",
        phones: ["+96176427659", "+905399515090"],
        email: "traversa.compary@yahoo.com",
        imageData: ""
      };
      // create a vcard file
      var vcard =
        "BEGIN:VCARD\nVERSION:3.0\nFN:" +
        contact.name +
        "\nTEL;TYPE=work,voice:" +
        contact.phones[0] +
        "\nTEL;TYPE=work,voice:" +
        contact.phones[1] +
        "\nEMAIL:" +
        contact.email +
        "\nPHOTO;MEDIATYPE=image/jpeg;ENCODING=b;TYPE=JPEG:" +
        contact.imageData +
        "\nEND:VCARD";

      var blob = new Blob([vcard], {
        type: "text/vcard"
      });
      var url = URL.createObjectURL(blob);

      const newLink = document.createElement("a");
      newLink.download = contact.name + ".vcf";
      newLink.textContent = contact.name;
      newLink.href = url;

      newLink.click();
    });
  </script>
</body>

</html>